import React from 'react';
import MovieItem from './OrderRow';
import '../App.css';

function OrderTable({ movies }) {
    return (
        <div className="collection-container">
            {movies.map((movie, i) => <MovieItem movie={movie} key={i} />)}
        </div>
    );
}

export default OrderTable;
